        <div className="top-item">

          <p> Let's build something <i class="fas fa-hammer"></i>ogether!</p>

        </div>

        <div className="top-item">
          <p>OLEG GELFAND</p>
        </div>
        <div className="top-item">
          <p>About Me <i class="fa fa-child"></i><i class="fa fa-baby"></i><i class="fa fa-child"></i></p>
        </div>
      </div>
      </header>
  );
}

export default NavTop;
